import { justFetch } from "../Services/JustFetchService"

const getPeriodName=(dataPe,dataItems)=>{
    let data=[]

    dataPe.map((pe)=>{
        let periodName=""
        periodName= dataItems[pe].name
      //   console.log(periodName)
        data=[...data,periodName]
    })

    return data;
}


const getData=(url)=>{
    return justFetch(url,{}).then((res)=>{
        return res
    })
}

export {
    getPeriodName,
    getData
}
